import React from 'react';
import User from './User';

const Users = ({ users }) => {
    console.log(users);
    return ( 
        <>
            <table>
            <tr>
                <th>Nome</th>
                <th>Email</th>
            </tr>
            <tr>
            {
                users.map((user) => (
                    <User user={user} />
            ))}
                <td>Alfreds Futterkiste</td>
                <td>Maria Anders</td>
            </tr>
            </table>
        </>
     );
}

export default Users;
